tables.table_schema:
CREATE TABLE property_ownership (
  country_code STRING PRIMARY KEY,
  owner_name STRING,
  property_address STRING,
  property_value DECIMAL
);

CREATE TABLE property_regulations (
  country_code STRING PRIMARY KEY,
  property_type STRING,
  tax_rate DECIMAL,
  regulation_notes TEXT
);

CREATE TABLE PropertyOwnership (
  owner_id INT PRIMARY KEY,
  property_id INT,
  country VARCHAR,
  owner_name VARCHAR
);

CREATE TABLE Taxes (
  tax_id INT PRIMARY KEY,
  property_id INT,
  country VARCHAR,
  tax_amount DECIMAL
);

CREATE TABLE Regulations (
  regulation_id INT PRIMARY KEY,
  country VARCHAR,
  regulation_details VARCHAR
);

CREATE TABLE Regulations (
    regulation_id INT PRIMARY KEY,
    country_code VARCHAR(2),
    regulation_type VARCHAR(50),
    regulation_description TEXT
);

CREATE TABLE CountryInfo (
    country_code VARCHAR(2) PRIMARY KEY,
    country_name VARCHAR(100),
    continent VARCHAR(50),
    currency VARCHAR(3)
);

CREATE TABLE property_regulations (
    regulation_id UUID PRIMARY KEY,
    regulation_description TEXT,
    country VARCHAR(50)
);

CREATE TABLE country_info (
    country_id UUID PRIMARY KEY,
    country_name VARCHAR(50),
    currency VARCHAR(10),
    language VARCHAR(20)
);
